Defendant Jaqwaun D Winston in court with attorney Terese M Dick.  Defendant Jaqwaun D Winston in custody.  Kimberly D Schoepp appeared for the State of Wisconsin.  Parties have reached a resolution.  Pursuant to negotiations, the State moved to dismiss but read in  Count 2.  Court granted State's motion and ordered Count 2 dismissed but read in.

AS TO COUNT 01:
Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.  The Court advised defendant that as a convicted felon not to possess any firearms/body armor.    Court further advised defendant of voting ineligibility. 

Sentencing proceeded.  Statements by the State, defense and defendant.  The Court imposed the following sentence:

Defendant's TOTAL LENGTH OF SENTENCE shall be two (2) years consecutive to 14CF000032.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for one (1) year with credit for 4 days time served.  Defendant shall serve one (1)  year on EXTENDED SUPERVISION.    The defendant is  eligible for the Challenge Incarceration Program AND for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of three (3) years, concurrent to case 14CF000032.

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - No controlled substances or alcohol;
 - AODA assessment and treatment;
 - Urine screens;
 - No contact with Helen G.;
 - Obtain high school diploma, HSED or GED;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - No contact with co-actor Kamari Hudson;
 - Be given parenting counseling;
 - Be given cognitive thinking intervention counseling;
 - Pay restitution, joint and several to Helen G. in the stipulated amount of $917.39, joint and several, with co-actor, Kamari Hudson, in 14CM760, first; then pay all applicable costs, surcharges and disbursements.  Should defendant get revoked and be sent to prison, Court ordered monies taken from prison funds not to exceed 25%.  Balance to be paid while on extended supervision. Failure to pay amounts in full would result in a civil judgment entered against defendant, which is non-dischargable in bankruptcy.

